import React from 'react';

const CELL_SIZE = 30;

function Board({ board, onClick }) {
  return (
    <svg width={CELL_SIZE * board.length} height={CELL_SIZE * board.length}>
      {board.map((row, i) =>
        row.map((cell, j) => (
          <g key={`${i}-${j}`}>
            <rect
              x={j * CELL_SIZE}
              y={i * CELL_SIZE}
              width={CELL_SIZE}
              height={CELL_SIZE}
              fill="burlywood"
              stroke="black"
              onClick={() => onClick(i, j)}
            />
            {cell !== 0 && (
              <circle
                cx={j * CELL_SIZE + CELL_SIZE / 2}
                cy={i * CELL_SIZE + CELL_SIZE / 2}
                r={10}
                fill={cell === 1 ? "black" : "white"}
              />
            )}
          </g>
        ))
      )}
    </svg>
  );
}

export default Board;
